import "./App.css";
import React from "react";
import SearchBooks from "./components/SearchBooks";
import BookShelfPage from "./components/BookShelfPage";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <Routes>
        <Route exact element={<BookShelfPage />} path="/" />
        <Route exact element={<SearchBooks />} path="/search" />
      </Routes>
    </div>
  );
}

export default App;
